var e=[{title:"Ordenadores cu\xE1nticos y seguridad: \xBFc\xF3mo nos afectan?",date:"20/02/23 - 10:45",ubicacion:"Sal\xF3n de Actos de la ETSII",description:"Seguramente todos hemos le\xEDdo alguna noticia sobre avances en ordenadores cu\xE1nticos. En esta charla explicaremos c\xF3mo funcionan y por qu\xE9 se dice que pueden suponer un peligro para la seguridad de internet. \xBFPero est\xE1 todo perdido? Ni mucho menos. Tambi\xE9n hablaremos de toda la gente que est\xE1 trabajando para, por un lado, aprovechar las ventajas de la computaci\xF3n cu\xE1ntica, y por el otro aquellos que trabajan para que tengamos las defensas adecuadas.",ponente:"Sandra Guasch Castell\xF3",url:"https://www.eventbrite.es/e/entradas-conferencia-ordenadores-cuanticos-y-seguridad-como-nos-afectan-501127023417"},{title:"\xA1Llega la banca conversacional inclusiva!",date:"21/02/23 - 10:45",ubicacion:"Sal\xF3n de Actos de la ETSII",description:"La Banca Conversacional es un nuevo modelo de banca que surge de combinar estos tres elementos de la Inteligencia Artificial: Asistentes Virtuales, Biometr\xEDa de Voz y Avatares Realistas que permitir\xE1n a cualquier tipo de clientes poder hablar con naturalidad y su forma de expresi\xF3n para realizar cualquier operaci\xF3n financiera de forma c\xF3moda y f\xE1cil.",ponente:"Javier Porras Casta\xF1o",url:"https://www.eventbrite.es/e/entradas-conferencia-llega-la-banca-conversacional-inclusiva-528511631517"},{title:"Las pr\xF3tesis y su impacto",date:"21/02/23 - 10:45",ubicacion:"3.0.2 de la ETSII",description:"Os invitamos a la charla de Sarah Almagro, qui\xE9n nos contar\xE1 de primera mano su vida con pr\xF3tesis. Nos hablar\xE1 sobre c\xF3mo funcionan, las partes de las mismas, el impacto que tuvo sobre ella (y por consecuencia, el impacto de la labor del ingeniero biom\xE9dico), las actividades que le permite realizar e incluso qu\xE9 problemas presentan que, nosotros como futuros ingenieros, deber\xEDamos resolver. \xA1No os la perd\xE1is!",ponente:"Sarah Almagro",url:"https://www.eventbrite.es/e/entradas-conferencia-las-protesis-y-su-impacto-sarah-almagro-531176522277"},{title:"SECURE CODING 101",date:"22/02/23 - 10:45",ubicacion:"Sal\xF3n de Actos de la ETSII",description:"En esta charla abordaremos algunos de los principios de secure coding que he ido aprendiendo a lo largo de mi experiencia como software engineer y que aplico en mi d\xEDa a d\xEDa.",ponente:"Marta G\xF3mez Mac\xEDas",url:"https://www.eventbrite.es/e/entradas-conferencia-secure-coding-101-518616996397"},{title:"Ciberseguridad en entornos sociosanitarios, los nuevos retos de la tecnolog\xEDa Sanitaria",date:"22/02/23 - 10:45",ubicacion:"3.0.2 de la ETSII",description:"Actualmente los sistemas de salud se encuentran en la diana de los ciberdelincuentes, esto est\xE1 llevando a los equipos de ciberseguridad a analizar las problem\xE1ticas del sector y a plantear estrategias que permitan proteger uno de los pilares del estado de bienestar frente a las nuevas amenazas que ponen en peligro tanto sistemas de informaci\xF3n como la propia vida de los pacientes. En esta ponencia se analizar\xE1 c\xF3mo se est\xE1 tratando actualmente este problema y qu\xE9 soluciones a nivel tecnol\xF3gico y de arquitecturas de seguridad se est\xE1n adoptando en el sector.",ponente:"Jes\xFAs Do\xF1a Fern\xE1ndez",url:"https://www.eventbrite.es/e/entradas-conferencia-ciberseguridad-en-entornos-sociosanitarios-los-nuevos-retos-531168929567"}];export{e as c};
